import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

const Expenses = (props) => {
  return (
    <div className="expenses">
      <ExpenseItem
        title={props.title}
        date={props.date}
        amount={props.amount}
      ></ExpenseItem>
    </div>
  );
};

export default Expenses;
